import React from "react";
import "./forecast.scss";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import { CardHeader } from "@mui/material";
import Stack from "@mui/material/Stack";
import Paper from "@mui/material/Paper";
import { Clock } from "./clock";

const Forecast = (props) => {
  return (
    <div className="main">
      {props.we.cod === 200 ? (
        <Card className="cardmain">
          <Stack
            direction="row"
            justifyContent="space-between"
            alignItems="center"
            spacing={20}
            className="upperstack"
          >
            <Paper className="paper">
              <Clock />
            </Paper>
            <Paper className="paper">Date</Paper>
          </Stack>
          <Stack>
            <Stack direction="row" justifyContent="space-between">
              <Paper>
                <img
                  src={`http://openweathermap.org/img/wn/${props.we.weather.icon}@2x.png`}
                ></img>
              </Paper>
              <Stack>
                <Paper>{props.we.name}</Paper>
                <Paper>{props.we.weather[0].description}</Paper>
              </Stack>
            </Stack>
            <Paper>{props.we.main.feels_like}</Paper>
            <Paper>{props.we.main.temp}</Paper>
            <Stack direction="row" justifyContent="space-between">
              <Paper>L {props.we.main.temp_min}&deg;F</Paper>
              <Paper>H {props.we.main.temp_max}&deg;F</Paper>
            </Stack>
          </Stack>
          <Stack direction="row" justifyContent="space-between">
            <Stack direction="row" justifyContent="space-between">
              <Paper>image</Paper>
              <Paper>{props.we.wind.speed}</Paper>
            </Stack>
            <Stack direction="row" justifyContent="space-between">
              <Paper>image</Paper>
              <Paper>{props.we.main.humidity}</Paper>
            </Stack>
          </Stack>
        </Card>
      ) : null}
    </div>
  );
};
export default Forecast;
